    return(<div>
        <Slider/>
        <div>
            <section className="main">
                {produit.map((data,index)=>{
                    const { id, libelle, prix, enpromo, catheg, img } = data;
                    <ul>
                        <li>{id}</li>
                        <li>{libelle}</li>
                        <li>{prix}</li>
                        <li>{enpromo}</li>
                        <li>{catheg}</li>
                        <li>{img}</li>
                    </ul>
                })}
            </section>
        </div>
        </div>

    )
}
